By: @northduo 
We’re at Eystrahorn waiting for the sunset ❤️
@vincenzo_mazza_photography

Host: @northduo 
January 28th 2021 a team of Iceland based photographers are undertaking the biggest mission yet, travelling around the entire country and visiting countless location of indescribable beauty! In this video we get to meet some of the team members and there is also a Q&A at the end for the viewers to get a chance to learn more about Iceland!

Keep tuned on Iceland.explore and all the photographers accounts to take part of this epic journey from January 28th to February 13th!

